import React from "react";
import './index.css';


class Weather extends React.Component{
    render()
    {
        return(
           <div>
    <h4>{this.props.temperature}
    {this.props.weather}
    {this.props.wind}
    {this.props.humidity}
    {this.props.pressure}
    {this.props.Maxtemp}
    {this.props.Mintemp}
    {this.props.sunrise}
    {this.props.sunset}
    </h4>
               </div>
        );
    }
};
export default Weather;
